import React, { useState } from 'react'; // React
import PropTypes from 'prop-types'; // PropTypes
import ReactDatePicker from 'react-datepicker'; // React DatePicker

import Input from 'components/Input'; // Input
import styles from 'styles/components/DatePicker.module.css'; // Component styles

export default function DatePicker() {
  const [date, setDate] = useState(new Date());

  // const CustomInput = ({ value, onClick }) => (
  //   <input className={styles.datepicker__input} onClick={onClick} value={value} />
  // );

  return (
    <ReactDatePicker
      customInput={<Input className={styles.datepicker__input} />}
      className={styles.datepicker} // This is for the input component
      calendarClassName={styles.datepicker__calendar}
      wrapperClassName={styles.datepicker__wrapper} // Wraps input component
      popperClassName={styles.datepicker__popper} // Wraps calendar component that pops up
      monthClassName={() => styles.datepicker__month}
      dayClassName={() => styles.datepicker__day}
      weekDayClassName={() => styles.datepicker__weekDay}
      nextMonthButtonLabel=">"
      previousMonthButtonLabel="<"
      selected={date}
      onChange={date => setDate(date)}
      useWeekdaysShort
    />
  );
}
